‚Å£
For a long time we were absolutely done having babies. Our four kids are busy and the idea of adding another was terrifying. ‚Å£
‚Å£
I couldn't get all of the baby girl clothes out of our house fast enough. But the boy clothes? Each time a new nephew was born I went through the boy clothes to give to them. It was an emotional experience every time; there were some that I simply couldn't part with. A strange feeling that there was one more sweet little boy for our family lingered in my mind. Yet the timing was never right.‚Å£
‚Å£
Because I know that five kids is a lot! It's intimidating and scary. ‚Å£
‚Å£
We've had so many sweet experiences that led to the decision to try and this sweet blessing. Here's my favorite:‚Å£
‚Å£
Last November we were sitting down to dinner and, out of nowhere, all four of our kids started to ask us when we would have another baby. We told them we loved them all, joked they were a handful, and that we weren't going to have anymore kids. Slowly and sillily, they all started chanting and pounding to the beat on the table, "One more baby. One more baby." I'll never forget looking across and Brandon, laughing and smiling. Later that night I said "Whose kids beg for another sibling?!?" ‚Å£
‚Å£
